INSERT INTO [dbo].[article] (id, created_by, creation_date, last_modified_by, last_modified_date, name, status, text, image) VALUES
(1, 'tema105', '2017-02-22 12:38:53:000', 'tema105', '2017-04-14 10:05:37:000', 'testni članak', 'INACTIVE', '<p>pisem ti pismo da skupa vise nismo <br></p>', 1),
(2, 'tema105', '2017-02-22 15:38:30:000', 'tema105', '2017-04-19 14:55:01:000', 'Plan objave natječaja za 2017. godinu za mjere ruralnog razvoja', 'ACTIVE', '<p>Objavljen je indikativni plan objave natječaja za mjere ruralnog razvoja u 2017. godini. <a href="http://ruralnirazvoj.hr/plan-objave-natjecaja/" target="_blank">Plan objave natjecaja</a><br></p>', 2),
(3, 'tema105', '2017-02-27 12:09:55:000', 'tema105', '2017-02-27 12:09:55:000', 'ivica i marica', 'INACTIVE', 'Bio jednom jedan drvosječa koji je sa ženom i dvoje djece živio u maloj kolibi na kraju velike šume. Bili su jako siromašni. Često ni kruha nisu dovoljno imali. A žena je bila maćeha djeci – dječaku i djevojčici. Dječak se zvao Ivica, a djevojčica Marica.<br><br><div style="text-align: left;"><p>Zemljom je vladala glad. Nesretni drvosječa jedva je prehranjivao svoju obitelj. Jedne večeri, kad ni kruha nisu više imali, žena reče:<br>– E, ovako se više ne može. Biti će najbolje da djecu odvedemo daleko u šumu i tamo ih ostavimo. Naložiti ćemo im vatru, neka se griju. Možda će ih netko dobar pronaći i uzeti k sebi. Poslije, kad bude bolje, možemo ih mi opet uzeti.<br> Nesretni otac se pobuni i reče da on to nikako ne može učiniti. Ali je zla žena navaljivala sve dotle dok on, utučen i bespomoćan, na kraju ne pristade učiniti onako kako je ona predlagala. Djeca, koja od gladi nisu mogla zaspati, su sve čula i Marica gorko zaplaka.<br> Ivica je tješio svoju sestricu:<br>– Ne plači, Marice. Biti će dobro.<br> Kad su otac i maćeha zaspali, Ivica se polako išulja iz kuće. Nebo je bilo puno mjesečine i sjaja zvijezda. Bijeli kamenčići rasuti po dvorištu, blistali su poput dragog kamenja. Ivica ih pokupi, napuni džepiće svojih hlačica, lagano se vrati u kuću i reče Marici:<br>– Ne brini, sestrice! Biti će sve dobro. Spavaj.<br> I djeca zaspaše, svladana strahom i umorom. Tek što je svanulo, maćeha probudi djecu.<br>– Ustajte, djeco! Idemo u šumu po drva.<br> Dade svakom po komadić kruha i krenuše, jedno za drugim. Ivica je išao zadnji i stalno zastajkivao. To je on bacao bijele kamenčiće da obilježi stazu i da se poslije sa sestrom vrati kući. Maćeha primjeti da on nešto radi pa ga upita:<br>– Zašto se stalno okrećeš, Ivice?<br>– Gledam u moje bijelo mače. Eno ga, gore, na krovu kuće.<br> Maćeha nikakvo mače nije vidjela, ali ušuti i krene dalje. Uskoro su zašli duboko u šumu. Otac ode siječi drva, a djeca nakupiše suhog granja pa im maćeha naloži veliku vatru i reče:<br>– Sjedite tu, kraj vatre. Odoh ja pomoći ocu. Poslije ćemo zajedno kući.<br> Djeca poslušaše. Uskoro, od umora i straha zaspaše. Kad su se probudila, bila je uveliko noć. Marica zaplaka, a Ivica je počne tješiti.<br>– Ne plači, sestrice. Čim dođe Mjesec, odvesti ću te kući.<br> I zaista. Čim se Mjesec odvoji od planine, nebo se osu sjajem, a kamenčići zablještaše poput malih zvijezda. Dugo su djeca išla tragom kamenčića do svoje kuće. Tek u zoru zakucaše na vrata. <br>Maćeha ih izgrdi što su se zadržali u šumi, a otac je dugo grlio svoju djecu, presretan što su opet zajedno.<br> Uskoro opet glad uđe u malu kolibu. Maćeha reče ocu:<br>– Osim nešto kruha, u kući nemamo ni trunka hrane. Odvedimo djecu u šumu! Naći će ih neki dobar čovjek i uzeti k sebi. Kada nama bude bolje, vratiti ćemo ih kući.<br> Zaludu se nesretni otac opirao. Žena je navaljivala i navaljivala pa on, na kraju, pristade. Djeca su čula i ovaj razgovor. Ivica požuri po kamenčiće, ali su i vrata i prozori bili čvrsto zatvoreni. Marica zaplaka, a Ivica je tješio sestricu:<br>– Ne boj se! Biti će sve dobro.<br> Ujutro, rano, maćeha probudi djecu, dade im po komadić kruha i tako krenuše u šumu. I opet je Ivica bio zadnji i bacao mrvice kruha na stazu. Duboko u šumi otac ode nasiječi drva, maćeha naloži vatru i reče:<br>– Sjedite tu i čekajte nas! Odoh pomoći ocu. Poslije ćemo zajedno kući.<br> Djeca pojedoše komadić kruha što ga Marica izvadi iz svoje pregačice i zaspaše. Kad su se probudili, bila je već uveliko noć. Vatra se ugasila. Marica zaplaka, a Ivica joj reče:<br>– Ne plači, sestrice! Čim dođe Mjesec, odvesti ću te kući.<br> Kad se Mjesec pojavi iznad planine, sva noć se rasvijetli, ali mrvica kruha nigdje ne bi. Gladne ptice su ih pozobale još za dana.<br>– Ne plači, Marice – reče Ivica. – Naći ću ja put do kuće.<br> I uze bratac sestricu za ruku. Išli su išli, ali puta ne nađoše. I sutradan su stazu tražili, ali je šuma bivala sve gušća. Tek trećeg dana, kada od gladi i umora nisu mogli dalje, doletje neka snježnobijela ptica. Ne plašeći ih se nimalo, mašući krilima, pozva djecu za sobom. Išli su tako Ivica i Marica za pticom sve dok ne stigoše do nekakve male kuće. I zastadoše zadivljeni. Gle čuda! Kućica bijaše sva napravljena od medenjaka, marcipana, čokolade. Djeca počeše grickati od svega pomalo, a nekakav glas reče:<br>– Tko mi kuću moju dira? Tko mi ne da mira!<br> Ivica i Marica odgovoriše:<br>– Vjetar ludi što iz gore gudi, on ti kuću dira, on ti ne da mira!<br> I nastaviše se gostiti. Na kućici se otvore vrata i na njima se pojavi nekakva starica, pogurena, krezuba; ona reče kreštavim glasom:<br>– Dobra moja dječice! Samo vi ručkajte! Uđite u kuću. Dati će vama baka još kolačića.<br> Djeca poslušaše staricu. A ona ih nahrani i mlijekom napoji i u bijele krevetiće na spavanje odvede. Samo to nije bila nikakva dobra baka. Bila je to zla vještica koja je voljela mamiti djecu k sebi da ih može zatvoriti u svoju kućicu od kolača. Ujutro, vještica grubo prodrma djecu, razbudi ih, Ivicu zatvori u kavez, a Marici naredi:<br>– Hajde ljenjivice! Donesi vode, spremi svome bratu doručak. Mora se dobro ugojiti kako bih ga mogla što brže pojesti.<br> Marica gorko zaplaka, ali je morala poslušati vješticu. Dani su prolazili. Marica je prala, vodu nosila, bratu hranu kuhala. Vještica je svaki dan prilazila kavezu:<br>– Pruži prst Ivice! Jesi li se ugojio?<br> Pametni dječak bi kroz rešetke provukao nekakvu tanku kost, a vještica, koja nije dobro vidjela, ljutila se što je dijete i dalje mršavo. Najzad izgubi strpljenje i naredi:<br>– Marice, naloži veliku vatru! Neću više čekati!<br> Jadna Marica opet zaplaka. Plakala je, plakala, ali nije znala što napraviti. U neka doba vještica joj reče:<br>– Vidi je li vatra dovoljno jaka. Želim i kruh ispeći. <br>Djevojčica se dosjeti:<br>– Kako mogu vidjeti kad su vrata tako visoko.<br>– Glupa gusko! – naljuti se vještica – Nisu vrata visoko. Vidi kako ja mogu pogledati.<br> Istog trena kad se vještica približila peći i prignula se vratašcima, Marica je svom snagom gurne u vatru, čvrsto priklopi vratašca i zalupi rezu. Tako nestade zle vještice. A Marica pritrči kavezu, oslobodi Ivicu vičući iz sveg glasa:<br>– Slobodni smo, slobodni! Vještica je mrtva.<br> Njihovoj radosti i veselju nije bilo kraja. Nakupili su pune džepove kolača i medenjaka. Pronašli su i vještičino blago, pa i od njega uzeše. Onda požuriše da odu što dalje od vještičine kuće. <br>Začarana šuma se pred njima otvarala i djeca začas stigoše do nekakve velike rijeke. A na njoj ni mosta, ni skele. Djeca ugledaše jednu patku pa povikaše:<br>– Patkice, milenice! Duboka je voda, nemamo broda. Idemo daleko, prenesi nas preko!<br> Patka ih prenese preko vode i djeca nastaviše put. Šuma je bivala sve rjeđa, dok je sasvim ne nestade. Na ivici šume ukazala se njihova kućica. Ivica i Marica potrčaše. Proviriše kroz prozor i vidješe svoga oca, samog, tužnog. Kucnuše o okno. <br>Otac podiže glavu, ugleda ih. Dugo je grlio svoju dječicu. Visoko ih dizao u zrak, ljubio, čvrsto držao. Da se više nikada ne rastave.<br> I nisu se rastajali. Živjeli su dugo, sretno sve do kraja svoga života...</p></div><p><br></p>', 4),
(4, 'tema105', '2017-03-06 10:58:54:000', 'tema105', '2017-03-06 11:02:48:000', 'Najava natječaja za energetsku učinkovitost', 'ACTIVE', '<p>Natječaj je najavljen za treći kvartal godine. Prihvatljivi korisnici su mala i srednja poduzeća.<br></p>', 9),
(7, 'tema105', '2017-04-13 14:23:57:000', 'tema105', '2017-04-14 10:08:09:000', 'Interes za potpore mladim i malim poljoprivrednicima - mjere 6.1.1. i 6.4.1.', 'ACTIVE', '<p>APPRRR je 12.04.2017. objavio informaciju kako slijedom velikog broja upita i iskazanog interesa infermiraju potencijalne korisnike i zainteresiranu javnost o prijavama na nedavno završene natječaje u sklopu Mjere 6 "Razvoj poljoprivrednih gospodarstava i poslovanja". <br><br>Drugi natječaj za operaciju <b>6.1.1. "Potpora mladim poljoprivrednicima"</b> bio je raspisan od 21. prosinca 2016. do 24. veljače 2017. godine, a Agencija za plaćanja u poljoprivredi, ribarstvu i ruralnom razvoju zaprimila je 813 zahtjeva za potporu u iznosu tražene potpore od 306.370.920,00 kn. Raspoloživi iznos potpore za ovaj natječaj je 75.368.000,00 kn, a maksimalni i fiksni iznos potpore po korisniku 50.000,00 eura u kunskoj protuvrijednosti. <br><br>Za operaciju <b>6.3.1. "Potpora razvoju malih poljoprivrednih gospodarstava"</b> drugi natječaj bio je raspisan od 27. siječnja do 27. ožujka 2017. godine. Zaprimljeno je 4189 zahtjeva za potporu u iznosu tražene potpore od 474.988.615,50 kn. Raspoloživi iznos potpore u ovom natječaju je 151.261.593,00 kn, a visina potpore po korisniku iznosi 15.000 eura u kunskoj protuvrijednosti.&nbsp;&nbsp;</p><p><br></p><p><a href="http://www.apprrr.hr/iznimno-velik-interes-za-potpore-mladim-i-malim-poljoprivrednicima-2282.aspx" target="_blank">iznimno-velik-interes-za-potpore-mladim-i-malim-poljoprivrednicima</a></p><p><br><br></p>', 30),
(8, 'tema105', '2017-04-20 08:57:41:000', 'tema105', '2017-04-20 08:58:34:000', 'Tjedan EU fondova 2017.', 'ACTIVE', '<p>Ministarstvo regionalnoga razvoja i fondova Europske unije, u suradnji s drugim partnerskim institucijama, najavljuje održavanje informativno-edukativnog događaja pod nazivom „Tjedan EU fondova“ koji će se održati <strong>od 24. do 28. travnja 2017.</strong> u hotelu <strong>Sheraton</strong> u Zagrebu (Ulica kneza Borne 2).<br><br> Ministarstvo regionalnoga razvoja i fondova Europske unije je nacionalno tijelo odgovorno za koordinaciju informativnih i obrazovnih aktivnosti o korištenju europskih strukturnih i investicijskih fondova (ESI fondova). Svrha koordinacije je osiguranje pravovremene podrške i jačanja postojećih kapaciteta državne i javne uprave, jedinica lokalne i regionalne (područne) samouprave, nevladinih organizacija, znanstvenog sektora i drugih potencijalnih korisnika u aspektima ključnim za uspješno korištenje sredstava iz ESI fondova.<br><br> Cilj ovog petodnevnog događanja je široj javnosti i potencijalnim korisnicima predstaviti mogućnosti korištenja&nbsp;europskih strukturnih i investicijskih fondova,&nbsp; kao i dobrobiti koju oni nose Republici Hrvatskoj. U okviru svakog pojedinog dana predstavit će se mogućnosti financiranja iz različitih tematskih područja ulaganja u financijskoj perspektivi 2014.-2020., prikazati primjeri dobre prakse i razmijeniti iskustva kroz panel diskusije.</p><p><br></p><p><strong>Detaljan program „Tjedna EU fondova“ možete vidjeti </strong><a href="http://www.strukturnifondovi.hr/UserDocsImages/Novosti/Objedinjeni%20program%20Tjedna%20EU%20fondova%2019.4..pdf" target="_blank" data-fileid="4296"><strong><u><font color="#0066cc">ovdje</font></u></strong></a>.</p><p><a href="http://www.strukturnifondovi.hr/UserDocsImages/Novosti/Objedinjeni%20program%20Tjedna%20EU%20fondova%2019.4..pdf" target="_blank" data-fileid="4296"><strong><u><font color="#0066cc"><br></font></u></strong></a><br></p>', 52);
