INSERT INTO [dbo].[tender] (id, created_by, creation_date, last_modified_by, last_modified_date, name, status, text, image) VALUES
(2, 'tema105', '2017-03-06 09:11:07:000', 'tema105', '2017-04-20 08:39:10:000', 'Kompetentost i razvoj MSP 2017', 'ACTIVE', '<p>Natječaj je namijenjen poticanju&nbsp; investicija&nbsp; u&nbsp; početna&nbsp; ulaganja&nbsp; povezana&nbsp; s&nbsp; osnivanjem&nbsp; nove poslovne&nbsp; jedinice,&nbsp; proširenjem&nbsp; kapaciteta&nbsp; postojeće&nbsp; poslovne&nbsp; jedinice, diversifikacijom&nbsp; proizvodnje&nbsp; poslovne&nbsp; jedinice&nbsp; na&nbsp; proizvode&nbsp; koje dotična&nbsp; poslovna jedinica&nbsp; prethodno&nbsp; nije&nbsp; proizvodila&nbsp; ili&nbsp; temeljitom&nbsp; promjenom&nbsp; u&nbsp; sveukupnom proizvodnom procesu postojeće poslovne jedinice. <br><br></p>', 6),
(3, 'tema105', '2017-03-06 09:15:53:000', 'tema105', '2017-04-19 15:28:56:000', 'Informacijsko komunikacijske tehnologije', 'ACTIVE', '<p>Otvoren je novi natječaj informacijsko-komunikacijske tehnologije za male i srednje poduzetnike koji su registrirani u jedinicama lokalne samouprave s indeksom razvjenosti I. i II.<br></p>', 8),
(4, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-18 08:57:04:000', 'Povećanje razvoja novih proizvoda i usluga koji proizlaze iz aktivnosti istraživanja i razvoja', 'ACTIVE', '<p>Cilj ovog Poziva je dodjeljivanje državne potpore za aktivnosti istraživanja i razvoja poslovnog sektora s ciljem razvoja novih proizvoda, usluga, tehnologija i poboljšanja poslovnih procesa te povećanje njihove suradnje sa znanstveno istraživačkim institucijama.      <br>Potpore će se dodjeljivati poduzetnicima koji provode projekte istraživanja i razvoja u skladu s identificiranim prioritetnim tematskim područjima i međusektorskim temama Strategije pametne specijalizacije Republike Hrvatske.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></p>', 12),
(5, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 14:48:06:000', 'Komercijalizacija inovacija u poduzetništvu', 'ACTIVE', '<font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;">Fond:</span><span style="font-size: 9pt;"> Europski fond za regionalni razvoj </span></font></font><font color="#000000" face="Times New Roman" size="3"><br></font><font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;">Operativni program:</span><span style="font-size: 9pt;"> Operativni program Konkurentnost i kohezija 2014.-2020. </span></font></font><font color="#000000" face="Times New Roman" size="3"><br></font><font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;">Tip natječaja:</span><span style="font-size: 9pt;"> Otvoreni poziv na dostavu projektnih prijedloga (bespovratna sredstva)</span></font></font><font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;"><br></span></font></font><font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;">Status:</span><span style="font-size: 9pt;"> otvoren od 9.12.2016. do 31.12.2017. </span></font></font><font color="#000000" face="Times New Roman" size="3"><br></font><font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;">Nadležno tijelo:</span><span style="font-size: 9pt;"> Ministarstvo gospodarstva, poduzetništva i obrta </span></font></font><font color="#000000" face="Times New Roman" size="3"><br></font><font color="#000000"><font face="Times New Roman"><span style="font-size: 9pt;">Područje:</span><span style="font-size: 9pt;"> malo i srednje poduzetništvo </span></font></font><font color="#000000" face="Times New Roman" size="3"><br></font><span style="font-size: 9pt;"><font color="#000000" face="Times New Roman">Sažetak:</font></span><span style="font-size: 9pt;"><font color="#000000" face="Times New Roman"> Trajno otvoreni Poziv na dostavu projektnih prijava će se provoditi u okviru Operativnog programa Konkurentnost i kohezija 2014.-2020., Prioritet 3 „Poslovna konkurentnost“; Investicijski prioritet 3d „Potpora stvaranju kapaciteta MSP-a za uključivanje u proces rasta na regionalnim, nacionalnim i međunarodnim tržištima i inovacijskim procesima“; Specifični cilj 3d2 „Povećana inovativnost MSP–ova“.</font></span><span style="font-size: 9pt;"><font color="#000000" face="Times New Roman"><br>\n</font></span><span style="font-size: 9pt;"><font color="#000000" face="Times New Roman">Bespovratna sredstva dodjeljivat će se putem trajno otvorenog Poziva na dostavu projektnih prijava s krajnjim rokom dostave projektnih prijava 31. prosinca 2017. godine, odnosno do iskorištenja raspoloživih sredstava u ukupnoj vrijednosti &nbsp;114.000.000,00 kuna.</font></span><p><span style="font-size: 9pt;"><font color="#000000" face="Times New Roman">Poziv je namijenjen &nbsp;mikro, malim ili srednjim poduzećima sukladno definiciji utvrđenoj u Prilogu I. Definicija malih i srednjih poduzeća Uredbe Komisije (EU) br. 651/2014.</font></span><font color="#000000" face="Times New Roman" size="3"><br></font></p>', 19),
(6, 'tema105', '2017-04-18 08:15:30:000', 'tema105', '2017-04-18 08:17:41:000', 'Test 18042017', 'ACTIVE', '<p>&nbsp;&nbsp;&nbsp;&nbsp;test<br></p>', 48);
