(77, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, 'priprema zemljišta; \nkrčenje zemljišta; \ntrošak gradnje, rekonstrukcije zgrada, poslovnih prostorija, drugih objekata i uređenje pripadajuće \nparcele  \ntrošak održavanja i /ili preuređenja, modernizacije zgrada, poslovnih prostorija, drugih objekata i \nuređenje pripadajuće parcele  \nkomunalni doprinos, cijene vodnih i energetskih priključaka,  \ntrošak uporabne dozvole; \nnabava novih strojeva, opreme, alata, radnih vozila i strojeva, te s njima povezani troškovi aktiviranja, transporta, montaže i stavljanja u pogon, ako ih u pogon stavlja dobavljač.  \ntroškovi montaže opreme i strojeva ukoliko su prikazani na istom računu  s nabavljenom opremom te predstavljaju sastavni dio nabave opreme; \nulaganja u mjere energetske učinkovitosti, povezana sa svrhom projekta; \nnabava mjernih uređaja povezanih s projektom; \ntroškovi informatičko-komunikacijskih i audio/video rješenja (hardver) koji su izravno povezani sa \nsvrhom projekta \nnabava materijalne imovine putem zakupa ako zakup materijalne imovine ima oblik financijskog leasinga i sadržava obvezu korisnika potpore na kupnju imovine nakon isteka ugovora o zakupu. \nNabava patenata, autorskih prava, znanja ili drugih vrsta intelektualnog vlasništva,  troškovi informatičko-komunikacijskih i audio/video rješenja (softver) ako udovoljavaju čl. 7. Programa državnih potpora.', 30, 2),
(78, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, '?  Obrazac 1. Prijavni obrazac A; \n?  Obrazac 2. Investicijska studija; \n?  Obrazac 3. Izjava o usklađenosti s UZP-om s datumom ne starijim od 30 (trideset) dana \nprije  datuma  predaje  projektne  prijave,  ovjerena  pečatom  i  potpisana  od  strane  osobe \novlaštene za zastupanje te ovjerena od strane javnog bilježnika; \n?  Obrazac 4. Skupna izjava; \n?  Obrazac 5. Infrastrukturna komponenta projekta (ako je primjenjivo);  \n?  Obrazac 6. Izjava o korištenim potporama;  \n?  Obrazac 7. Izjava o korištenim potporama male vrijednosti za prijavitelja i pojednično za \nsvako povezano poduzeće koje se smatra “jednim poduzetnikom” (ako je primjenjivo); \n?  Potvrda  porezne  uprave  u  izvorniku  da  je  prijavitelj  ispunio  obveze  plaćanja  dospjelih \nporeznih  obveza  i  obveza  za  mirovinsko  i  zdravstveno  osiguranje  ne  starija  od  30 \n(trideset) dana od datuma predaje projektne prijave ili važeći jednakovrijedni dokument \nkoji je izdalo nadležno tijelo u državi sjedišta prijavitelja; \n?  BON2/SOL2  sa  stanjem  na  dan  ne  starijim  od  10  (deset)  dana  od  datuma  predaje \nprojektne  prijave  ili  važeći  jednakovrijedni  dokument  koji  je  izdalo  nadležno  tijelo  u \ndržavi sjedišta prijavitelja.', 31, 2),
(79, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, 'Projektne prijave podnose se u jednom zatvorenom paketu/omotnici isključivo preporučenom poštanskom pošiljkom ili osobnom dostavom od 1. kolovoza 2017. godine, a najkasnije do 31. prosinca 2017.  godine na adresu: \nMinistarstvo gospodrastva, poduzetništva i obrta \nUlica grada Vukovara 78 \n10000 Zagreb \nNa zatvorenom  paketu/omotnici mora biti jasno naveden naziv  i  referentna oznaka Poziva: KK.03.2.1.05 s naznakom “Ne  otvarati  prije  službenog  otvaranja  prijava”, puni naziv i adresa prijavitelja-\nNa paketu/omotnici također mora biti zabilježen datum i točno vrijeme predaje  projektne  prijave.', 32, 2),
(80, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, 'Troškovi orisnika podmirit će se u skladu s “metodom nadoknade”, što podrazumijeva da: \n•  je trošak nastao;  \n- je korisnik platio nastale troškove u cijelosti; \n•  korisnik  provjerava prihvatljivost troškova i  podnosi zahtjev za nadoknadom  HAMAG-BICRO-u, s dokazom o uplati; \n•  HAMAG-BICRO  provjerava  troškove  te  donosi  zaključak  o  njihovu odobravanju/odbijanju; \n•  MINPO provodi isplate odobrenog iznosa korisniku.  \nRok  za  izvršenje  plaćanja  korisniku  je  30  (trideset)  dana  od  dana  isteka  roka  za  pregled predmeta  obveze,  odnosno  30  (trideset)  dana  od  dana  isteka  roka  za  provjeru  Zahtjeva  za predujam/Zahtjeva za nadoknadom sredstava. Isplate Korisniku vrše se u kunama.', 33, 2),
