(83, 'tema105', '2017-03-06 09:15:53:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Poziv je namijenjen MSP koja posluju u jedinicama regionalne i lokalne samouprave u područjima s razvojnim posebnostima, s ciljem jačanja njihove tržišne pozicije i povećanja konkurentnosti te ujednačenog razvoja svih područja RH. Područja s razvojim posebnostima ovim Pozivom definirana su kao područja jedinica lokalne samouprave koje pripadaju brdsko-planinskim područjima sukladno Zakonu o brdsko-planinskim područjima ili jedinica lokalne samouprave koje se nalaze na otocima i otočnim skupinama sukladno Zakonu o otocima ili području  jedinica područne (regionalne) samouprave koje prema indeksu razvijenosti spadaju u I. skupinu i/ili jedinica lokalne samouprave koje spadaju u I., II. i III. skupinu sukladno Odluci o razvrstavanju jedinica lokalne i područne (regionalne) samouprave prema stupnju razvijenosti.', 1, 3),
