(118, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Troškovi  nabave  standardnih  i  out-of-box  softvera  i  izrade/razvoja  specifičnog softvera (dizajniran po mjeri za potrebe korisnika), uključujući i njegovo instaliranje, programiranje,  testiranje  i/ili  konfiguraciju  za  potrebe  korisnika  (npr.  DMS,  ERP, CMS, ECM, CRM, CAD, CAM); \nTroškovi za licence za nadogradnju softvera; \nTroškovi  za  korištenje  SaaS  (Software  as  a  Service)  modela/usluge  do  najviše  10% ukupne vrijednosti projekta; \nTroškovi  nabave  računalne  opreme,  uključujući  i  instaliranje,  programiranje  i/ili konfiguraciju za potrebe korisnika;  \nIzdaci  za  ostalu  opremu  i  uređaje  potrebne  za  izravne  projektne  aktivnosti  (UPS, aktivna i pasivna mrežna oprema, mrežni ormar/rack, itd.); \nTroškovi obuke zaposlenika za korištenje novih sustava; \nTroškovi za manje infrastrukturne zahvate/radove potrebne za uvođenje IKT sustava (npr.  umrežavanje  opreme,  strukturno  kabliranje,  konstrukcija  server  sobe,  itd.),  za koje nije potrebna građevinska dozvola/potvrda glavnog projekta/rješenje za građenje, do najviše 20.000,00 HRK; \nTroškovi za usluge vanjskog stručnjaka za pripremu i provođenje postupaka nabave, do najviše 10.000,00 HRK; \nTroškovi usluga vanjskog stručnjaka za vođenje projekta, do najviše 10.000,00 HRK; \nTroškovi usluge financijske revizije, za projekte s potporom jednakom ili većom od 500.000,00 HRK do najviše 10.000,00 HRK;', 30, 3),
(119, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Obrazac 1. Prijavni obrazac A; \nObrazac 2. Prijavni obrazac B;  \nObrazac 3. Izjava o usklađenosti s Uputama za prijavitelje s datumom ne starijim od 30 dana  prije  datuma  predaje  projektne  prijave,  ovjerena  pečatom  i  potpisana  od  strane osobe ovlaštene po zakonu za zastupanje te ovjerena od strane javnog bilježnika;  \nObrazac  4.  Skupna  izjava  ovjerena  pečatom  i  potpisana  od  strane  osobe  ovlaštene  po zakonu za zastupanje;  \nObrazac 5. Izjava o nekažnjavanju (pojedinačno za svaku osobu ovlaštenu po zakonu za zastupanje prijavitelja / za svaki povezani subjekt / za svaki partnerski subjekt);  \nObrazac 6. Izjava o korištenim potporama male vrijednosti za prijavitelja i pojedinačno za  svako  povezano  poduzeće  koje  čini  “jednog  poduzetnika”,  ovjerene  pečatom  i potpisane od strane osobe ovlaštene po zakonu za zastupanje za predmetno poduzeće; \nPotvrda porezne uprave u izvorniku da je prijavitelj, kao i povezani subjekt/i i partnerski subjekt/i  ispunio  obveze  plaćanja  dospjelih  poreznih  obveza  i  obveza  za  mirovinsko  i zdravstveno osiguranje ne starija od 30 dana od datuma predaje projektne prijave\nBON2/SOL2  u  izvorniku  sa  stanjem  na  dan  ne  starijim  od  5  dana  od  datuma  predaje projektne prijave.', 31, 3),
(120, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Projektne prijave podnose se u jednom zatvorenom paketu/omotnici isključivo preporučenom poštanskom pošiljkom ili osobnom dostavom na sljedeću adresu: \nMinistarstvo poduzetništva i obrta \nUlica grada Vukovara 78 \n10000 Zagreb \nNa zatvorenom paketu/omotnici mora biti jasno navedena naziv i referentna oznaka Poziva s naznakom  “Ne  otvarati  prije  službenog  otvaranja  prijava”,  puni  naziv  i  adresa prijavitelja.', 32, 3),
(121, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'MINPO  provodi  isplate  odobrenog  iznosa  korisniku.  Rok  za  izvršenje  plaćanja Korisniku  je  30  dana  od  dana  isteka  roka  za  pregled  predmeta  obveze,  odnosno  30 dana od dana isteka roka za provjeru Zahtjeva za predujam/Zahtjeva za nadoknadom sredstava. Isplate Korisniku vrše se u kunama.', 33, 3),
