(124, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-13 13:58:40:000', NULL, 'Cilj ovog Poziva  je podržati razvoj novih proizvoda (dobara i usluga), tehnologija i poslovnih procesa  kroz  povećanje  privatnih  ulaganja  u  istraživanje,  razvoj  i  inovacije,  te  jačanje kapaciteta  poduzeća  za  istraživanje,  razvoj  i  inovacije,  kroz  poboljšanje  njihove  suradnje  s institucijama za istraživanje i razvoj.  Specifični cilj: Novi proizvodi i usluge kao rezultat djelatnosti istraživanja, razvoja i inovacija (IRI).', 1, 4),
