(155, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-14 08:35:00:000', NULL, 'Projekti moraju uključivati neke od sljedećih aktivnosti: \n1.  Temeljno istraživanje - eksperimentalni ili teorijski rad s ciljem stjecanja novih znanja o temeljnim načelima fenomena i vidljivih činjenica, bez predviđene izravne tržišne primjene ili uporabe \n2.  Industrijsko istraživanje - istraživanje ili kritički pregled s ciljem stjecanja novih znanja i vještina za razvoj  novih  ili  znatna  poboljšanja  postojećih  proizvoda,  procesa  ili  usluga  odnosno  za  postizanje znatnog poboljšanja postojećih proizvoda, procesa ili usluga. Može uključivati izradu prototipova u laboratorijskom okruženju te pilot projekt. \n3.  Eksperimentalni razvoj - stjecanje, kombiniranje, oblikovanje i uporaba postojećih znanja i vještina u \ncilju razvoja novih ili poboljšanja postojećih proizvoda, procesa ili usluga  \n4.  Studija izvedivosti - analiza potencijala projekta, čiji je cilj podržati proces donošenja odluka te utvrditi \nresurse potrebne za provedbu projekta i u konačnici njegove izglede za uspjeh \n \nProjekti koji obuhvaćaju temeljno istraživanje moraju uz sebe imati i neku od drugih aktivnosti. Projekte koji se sastoje samo od izrade studije izvedivosti mogu prijaviti isključivo velika poduzeća, dok se kod malih i srednjih poduzeća studija izvedivosti može prijaviti isključivo u kombinaciji s nekom od ostalih aktivnosti. \n\nKorisnik potpore mora osigurati financijski doprinos od minimalno 25% prihvatljivih troškova iz vlastitih izvora ili u obliku oslobođenom od bilo kakve državne potpore.', 28, 4),
