(159, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-14 08:20:06:000', NULL, '- Troškovi plaća osoblja zaposlenog kod prijavitelja i partnera\n- Trošak plaća zaposlenih osoba u znanstveno-istraživačkim institucijama koje primaju plaću iz Državnog proračuna RH\n- Neizravni  troškovi  (troškovi  najma  prostora,  režijski  troškovi  koji  uključuju grijanje/hlađenje, struju, vodu, odvoz otpada i telekomunikacije) nastali izravno kao posljedica  provedbe  istraživačkog  projekta\n- Troškovi upravljanja projektom \n- Troškovi  repromaterijala,  potrošne  robe  i  sličnih proizvoda, koji su  nastali izravno kao posljedica projektnih aktivnosti i temelje se na stvarnim troškovima\n- Troškovi  amortizacije instrumenata i opreme\n- Troškovi  ugovornog  istraživanja, znanja i patenata kupljenih ili licenciranih iz vanjskih izvora po tržišnim uvjetima, kao i troškovi savjetovanja tehnoloških usluga različitog tipa i sličnih usluga \n- Troškovi ulaganja u materijalnu imovinu koja se koristi za aktivnosti istraživanja i razvoja \n- Troškovi ulaganja u nematerijalnu imovinu\n- Izdaci jamstava za pred-financiranje koja izdaje banka ili druga financijska institucija\n- Izdaci  povezani  s  uslugom  revizije  projekta  za  projekte  čiji  ukupno  prihvatljivi troškovi projekta premašuju 1.500.000,00 HRK\n- Trošak  objavljivanja  vlastitih  rezultata  istraživanja  i  trošak  priopćavanja  rezultata projekta', 30, 4),
