(162, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-14 08:35:00:000', NULL, 'Metoda nadoknade što podrazumijeva da je:  \n-?  Trošak nastao;  \n-?  Korisnik platio nastale troškove u cijelosti;  \n-?  Korisnik  provjerio  prihvatljivost  troškova  i  podnio  zahtjev  za  nadoknadom  PT2 (HAMAG - BICRO),  s dokazom o uplati\n-?  PT2 provjerio troškove te donio zaključak o njihovu odobravanju/odbijanju \n-?  PT1 (MIGPO) proveo isplatu odobrenog iznosa Korisniku.', 33, 4),
