(165, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:16:24:000', NULL, 'Cilj ovog Poziva je podržati projekte usmjerene ka novim proizvodima i uslugama s višom i visokom dodanom vrijednošću koje imaju pozitivan učinak na poslovne rezultate i rast poduzeća te s tržišnim potencijalom na međunarodnoj razini.\nPozivom su predviđene:\n       A) Potpore za inovacije za MSP-ove\n       B) Potpore za inovacije procesa i organizacije poslovanja\n       C) Potpore male vrijednosti (pod uvjetom da su dodijeljene potpore navedene u točkama A i B)', 1, 5),
