(196, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:48:56:000', NULL, '1. Potpore za inovacije za MSP-ove (intenzitet potpore ne smije premašivati 50% prihvatljivih troškova)\n•	Troškovi savjetodavnih usluga za inovacije  \n•	Troškovi pomoćnih usluga za inovacije \n•	Troškovi dobivanja, potvrđivanja i zaštite patenata i ostale nematerijalne imovine (intelektualnog vlasništva) \n•	Troškovi upućivanja visokokvalificiranog osoblja iz organizacije za istraživanje i širenje znanja ili velikog poduzetnika  na rad na novootvoreno radno mjesto kod poduzetnika\n\n2. Potpore za inovacije procesa i organiziranje poslovanja (intenzitet potpore ne smije premašivati 50% prihvatljivih troškova)\n•	Troškovi osoblja (plaće osoblja prijavitelja koje je izravno uključeno u rad na projektnim aktivnostima)\n•	Troškovi instrumenata, opreme, zgrada i zemljišta vezane uz projektne aktivnosti (za instrumente, opremu i zgrade se smatraju prihvatljivim samo troškovi amortizacije ili zakupa u opsegu i u razdoblju u kojem se upotrebljavaju za projekt; za zemljišta se prihvatljivim smatraju samo troškovi ustupanja na komercijalnoj osnovi i stvarno nastali kapitalni troškovi)\n•	Režijski troškovi, troškovi materijala, troškovi potrošne robe i sličnih proizvoda, nastali izravno uslijed projekta\n•	Troškovi istraživanja temeljem ugovora s drugim stranama\n•	Troškovi znanja i patenata i ostale nematerijalne imovine koji se pribavljaju ili licencijom ustupaju od drugih strana po tržišnim uvjetima\n\n3. Prateće aktivnosti povezane s provedbom projekta (de minimis potpora čiji intenzitet potpore ne smije premašivati 75% prihvatljivih troškova) \n•	Revizija projekta\n•	Promidžba i vidljivost\n•	Priprema natječajne dokumentacije\n•	Usluge upravljanja projektom', 30, 5),
(197, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:48:56:000', NULL, '•	Prijavni obrazac A\n•	Elaborat ekonomske opravdanosti projekta\n•	Izjava o usklađenosti s Uputama za Prijavitelje ne starija od 30 dana prije predaje projektne prijave \n•	Skupna izjava \n•	Izjava o dodijeljenim potporama\n•	Izjava o korištenim potporama male vrijednosti \n•	Izjava o statusu intelektualnog vlasništva (IV) na kojem se temelji projektni prijedlog (i popratna dokumentacija o statusu intelektualnog vlasništva kako je navedeno) – ukoliko je primjenjivo\n•	BON2/SOL2 ne stariji od 5 dana prije predaje projektne prijave\n•	Potvrda porezne uprave o podmirenju poreznih obveza ne starija od 30 dana prije predaje projektne prijave', 31, 5),
(198, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:48:56:000', NULL, 'Projektna prijava podnosi se u jednom tiskanom primjerku i jednom elektroničkom primjerku (CD ili DVD s oznakom R) u zatvorenim paketima, isključivo preporučenom poštanskom pošiljkom ili osobnom dostavom na adresu:\nMinistarstvo  gospodarstva, poduzetništva i obrta\nUlica grada Vukovara 78\n10 000 Zagreb\nNa zatvorenoj omotnici mora biti jasno naveden naziv i referentna oznaka Poziva s naznakom “Ne otvarati prije službenog otvaranja prijava”, zatim puni naziv i adresa prijavitelja te mora biti zabilježen datum i točno vrijeme predaje projektne prijave.\n\nEvaluacija projektnih prijava izvršavat će se prema redoslijedu predaje na poštu, odnosno osobne predaje u Ministarstvo. Rok za evaluaciju projektnih prijava procjenjuje se na 120 kalendarskih dana od dana zaprimanja projektne prijave. Evaluacija projektnih prijava vrši se u nekoliko koraka:\n\n1.	faza – Zaprimanje, registracija i administrativna provjera\n2.	faza – Provjera prihvatljivosti prijavitelja, projekta, aktivnosti i troškova te ocjenjivanje kvalitete\n3.	faza – Odluka o financiranju', 32, 5),
(199, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 14:25:08:000', NULL, 'Odluka  o  financiranju  se  donosi  za  projektne  prijedloge  koji  su  uspješno  prošli  prethodne  faze  postupka dodjele.  MGPO  će  u  suradnji  s  HAMAG-BICRO-om  i  korisnikom  pripremiti  Ugovor o dodjeli bespovratnih sredstava u  roku  od  30  (trideset) kalendarskih dana od dana donošenja Odluke o financiranju. \nMogućnosti  i  uvjeti  za  podnošenje  zahtjeva  za  predujmom/nadoknadom  sredstava  i  korištenje  predujma određeni su u Ugovoru.  Uvjet za isplatu predujma je bankovna garancija koja se dostavlja HAMAG-BICRO-u. Bankovna garancija mora  glasiti  na  MGPO,  na  iznos  traženog  predujma  s  rokom  važenja  najmanje  120  (stodvadeset) kalendarskih dana od datuma završetka razdoblja provedbe Projekta. Korisnik ima pravo zatražiti predujam podnošenjem Zahtjeva za predujmom HAMAG-BICRO-u. Korisnik može potraživati predujam višekratno, najviše do 40% odobrenih bespovratnih sredstava po projektu.  \nKorisnik podnosi Zahtjev za nadoknadom sredstava (Izvješće o napretku) HAMAG-BICRO-u u roku od 15 dana  od  isteka  svaka  tri  mjeseca  od  dana sklapanja  Ugovora. Troškovi korisnika podmirit će se u skladu s “metodom nadoknade”. Rok za izvršenje plaćanja korisniku je 30 dana od dana isteka roka za pregled predmeta obveze, odnosno 30 dana  od  dana  isteka  roka  za  provjeru  Zahtjeva  za  predujam/Zahtjeva  za  nadoknadom  sredstava.  Isplate Korisniku vrše se u HRK.', 33, 5),
